import React from 'react';
import CardList from './CardList';
import corgis from './Corgis';
import SearchBox from './SearchBox';

const App = () => {
    return (
        <div>
            <h1>CorgiFriends</h1>
            <SearchBox />
            <CardList corgis={corgis} />
        </div>
    );
}

export default App;
